import { useState } from 'react';

function ViewServices(props) {
  const [editingService, setEditingService] = useState(null);

  function handleEdit(service) {
    setEditingService(service);
  }

  function handleDelete(serviceId) {
    props.onDelete(serviceId);
  }

  function handleCancelEdit() {
    setEditingService(null);
  }

  function handleSubmitEdit(formData) {
    props.onEdit(editingService.id, formData);
    setEditingService(null);
  }

  return (
    <table>
      <thead>
        <tr>
          <th>Service Type</th>
          <th>Name</th>
          <th>Location</th>
          <th>Price</th>
          <th>Availability</th>
          <th>Description</th>
          <th>Image</th>
          <th>Slots</th>
          <th>Edit</th>
          <th>Delete</th>
        </tr>
      </thead>
      <tbody>
        {props.services.map(service => {
          if (editingService && editingService.id === service.id) {
            return (
              <ServiceForm key={service.id} service={editingService} onCancelEdit={handleCancelEdit} onSubmitEdit={handleSubmitEdit}/>
            );
          } else {
            return (
              <tr key={service.id}>
                <td>{service.serviceType}</td>
                <td>{service.serviceName}</td>
                <td>{service.serviceLocation}</td>
                <td>{service.servicePrice}</td>
                <td>{service.serviceAvailability}</td>
                <td>{service.serviceDescription}</td>
                <td>{service.serviceImage}</td>
                <td>{service.serviceSlots}</td>
                <td><button onClick={() => handleEdit(service)}>Edit</button></td>
                <td><button onClick={() => handleDelete(service.id)}>Delete</button></td>
              </tr>
            );
          }
        })}
      </tbody>
    </table>
  );
}

export default ViewServices;
